import React, {useState, useEffect} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

import Button from 'react-bootstrap/Button';

function App() {
  const [testMessage, setTestMessage] = useState();

  //This function grabs data from flasks "/test" route and stores it in testMessage
  useEffect(() => {
    fetch('/test').then(res => res.json()).then(data => {
      setTestMessage(data.message);
    });
  }, [])

  return (
    <div>
      <p>This is the message: {testMessage}</p>
      <div>Welcome to a pure skeleton of what will soon become a TA Assignment application</div>
      <div>Please select your role</div>
      <Button class="m-2">UTA</Button>
      <Button class="m-2">PTIG</Button>
      <Button class="m-2">Grad-TA</Button>
      <Button class="m-2">Faculty</Button>
      <Button class="m-2">Admin</Button>
      <Button class="m-2">Super-User</Button>
    </div>
  );
}

export default App;
